# Find index of two numbers which equal target;

def two_sum(numbers, target):

    for i in range(len(numbers)):
        for j in range(len(numbers)):
            if i != j:
                if target - numbers[j] == numbers[i]:   # Or: n[i] + n[j] == target
                    first = j
                    second = i

    return first, second
    


